import React from 'react';


function Header() {
  return (
    <header className="header">
      <div className="container flex justify-between items-center">
        <a href="/" className="text-2xl font-bold">Directory Maker</a>
        <nav>
          <ul className="flex space-x-6">
            <li><a href="#features" className="hover:text-gray-700">Features</a></li>
            <li><a href="#pricing" className="hover:text-gray-700">Pricing</a></li>
            <li><a href="#faq" className="hover:text-gray-700">FAQ</a></li>
          </ul>
        </nav>
      </div>
    </header>
  );
}

export default Header;
